//Base URL
const baseUrl = "https://register.nomoreparties.co";

//Headers
const headers = {
  "Content-Type": "application/json",
};

//Auth Errors
const INVALID_INPUT_1 = "400 - one of the fields was filled in incorrectly";
const INVALID_INPUT_2 = "400 - one or more of the fields were not provided";
const USER_NOT_FOUND = "401 - the user with the specified email not found";
const TOKEN_INVALID_1 =
  "401 — Token not provided or provided in the wrong format";
const TOKEN_INVALID_2 = "401 — The provided token is invalid";

export {
  baseUrl,
  headers,
  INVALID_INPUT_1,
  INVALID_INPUT_2,
  USER_NOT_FOUND,
  TOKEN_INVALID_1,
  TOKEN_INVALID_2,
};
